//动态路由数组
import Home from '../views/home/Home'
import Center from '../views/center/Center'
import UserAdd from '../views/user-manage/UserAdd'
import UserList from '../views/user-manage/UserList'
import NewsAdd from '../views/user-manage/NewsAdd'
import NewsList from '../views/user-manage/NewsList'
import ProductAdd from '../views/user-manage/ProductAdd'
import ProductList from '../views/user-manage/ProductList'

const routes = [
    {
        path:'/index',
        component:Home
    },
    {
        path:'/center',
        component:Center
    },
    {
        path:'/user-manage/adduser',
        component:UserAdd
    },
    {
        path:'/user-manage/userlist',
        component:UserList
    },
    {
        path:'/news-manage/addnews',
        component:NewsAdd
    },
    {
        path:'/news-manage/newslist',
        component:UserList
    },
]

export default routes
